function formatNumber(t){return t=t.toString(),t[1]?t:"0"+t}function formatTime(t){const e=t.getFullYear(),o=t.getMonth()+1,r=t.getDate(),m=t.getHours(),n=t.getMinutes(),u=t.getSeconds();return[e,o,r].map(formatNumber).join("/")+" "+[m,n,u].map(formatNumber).join(":")}module.exports={formatTime:formatTime};